import React from 'react'

export default function DialogElement({ dialog, onClick }) {
    let date = new Date(dialog.lastDate);
    let lastDate = `${date.getHours()}:${date.getMinutes()}`

    return (
        <div className='chat-list--body-element' onClick={onClick}>
            <div className="chat-list--name-message">
                <p>{dialog.secondUsername}</p>
                <small className="hint">{dialog.lastMessage ?? 'no messages yet'}</small>
            </div>
            <time className="hint">{lastDate}</time>
        </div>
    )
}
